INSERT INTO `berita` VALUES (1,'Launching Sistem Informasi DPMD Kabupaten Bogor','launching-sistem-informasi-dpmd','<p>Dinas Pemberdayaan Masyarakat dan Desa Kabupaten Bogor dengan bangga mengumumkan peluncuran Sistem Informasi terpadu untuk meningkatkan pelayanan kepada masyarakat.</p><p>Sistem ini mencakup manajemen BUMDes, Perjalanan Dinas, dan Musyawarah Desa.</p>','Peluncuran sistem informasi terpadu DPMD untuk meningkatkan pelayanan masyarakat','1763033383151_logo_paris_870.jpeg','pengumuman','published','2025-11-13 18:24:15','Admin DPMD',7,'2025-11-13 11:24:15','2025-12-08 19:24:00'),(3,'Sosialisasi Aplikasi Musdesus Digital','sosialisasi-aplikasi-musdesus','<p>Musyawarah Desa kini dapat dilakukan secara digital melalui aplikasi Musdesus yang telah dikembangkan oleh DPMD.</p><p>Aplikasi ini memudahkan desa dalam mendokumentasikan dan melaporkan hasil musyawarah.</p>','Aplikasi Musdesus digital memudahkan desa dalam dokumentasi musyawarah',NULL,'musdesus','published','2025-11-13 18:24:15','Admin DPMD',1,'2025-11-13 11:24:15','2025-11-21 05:31:38'),(4,'testes','testes','testse',NULL,'1763033418458_download.jpg','umum','published','2025-11-13 11:30:18',NULL,2,'2025-11-13 11:30:18','2025-11-18 05:28:47'),(5,'Video Tutorial Sipanda','video-tutorial-sipanda','Video Tutorial Aplikasi Sipanda https://youtu.be/AVdyrfX7Iqo?si=bvjV1DlFjzSYsizU',NULL,'1763950152429_video-tutorial-bg.jpg','umum','published','2025-11-13 11:57:59','Admin DPMD',2,'2025-11-13 11:57:45','2025-11-24 02:09:32');
